import React from 'react';
import { Link } from ' react-router-dom';

const Navbar = () => {
  return (
    <nav className='navbar bg-dark'>
      <h1>
        <Link to='index.html'>
          <i className='fas fa-tshirt' /> the apparel agency
        </Link>
      </h1>
      <ul>
        <li>
          <Link to='profiles.html'>Lorem</Link>
        </li>
        <li>
          <Link to='register.html'>Ipsum</Link>
        </li>
        <li>
          <Link to='login.html'>Login</Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
